import styled from "styled-components";
import { useNavigate } from "react-router-dom";
import Slider from "../Components/Silder";
import Headfone from "../Assets/Imagens"

const categories = [
  { id: 1, title: "Celular", image: "/images/phone.png", slug: "celular" },
  { id: 2, title: "Headphone", image: "/images/headphone.png", slug: "headphone" },
  { id: 3, title: "Notebook", image: "/images/notebook.png", slug: "notebook" },
  { id: 4, title: "Acessórios", image: "/images/accessories.png", slug: "acessorios" }
];


// Componente funcional Home
const Home = () => {
  return(
    <Container>
      <Slider/>
    </Container>
  );
};


// Container principal
const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-color: #f5f5f5;
`;



// Título principal
const Title = styled.h1`
  font-size: 36px;
  font-weight: bold;
  color: #333333;
  margin-bottom: 20px;
`;





export default Home;
